webpackJsonp([0xf927f8900006],{378:function(A,e){A.exports={data:{site:{siteMetadata:{title:"jackyzhen.com",subtitle:"A Software Developer living in Auckland, NZ",menu:[{label:"Ramblings",path:"/"},{label:"About",path:"/about/"}],author:{name:"Jacky Zhen",email:"me@jackyzhen.com",github:"jackyzhen",linkedin:"jacky-shunjie-zhen-5b735042",rss:"https://jackyzhen.com/rss.xml"}}},markdownRemark:{id:"/Users/jackyzhen/go/src/github.com/jackyzhen/jackyzhen.com/src/pages/pages/2018-08-28---about/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1-a4273d963dd8b9a62311f520e55c4bd0-3833b.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="This is not me. This is an Ocelot kitten"\n        title=""\n        src="/static/1-a4273d963dd8b9a62311f520e55c4bd0-3833b.jpeg"\n        srcset="/static/1-a4273d963dd8b9a62311f520e55c4bd0-bf594.jpeg 240w,\n/static/1-a4273d963dd8b9a62311f520e55c4bd0-3833b.jpeg 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<blockquote>\n<blockquote>\n<p><em>This is not me. This is an ocelot kitten.</em></p>\n</blockquote>\n</blockquote>\n<p>I’m a software developer by trade, and I currently build neat things at <a href="https://movio.co/">Movio</a>. I live and work in beautiful <a href="https://en.wikipedia.org/wiki/Auckland">Auckland</a>, <a href="https://en.wikipedia.org/wiki/New_Zealand">New Zealand</a>.</p>\n<p>As a student, I was really into the <a href="https://dblp.uni-trier.de/pers/hd/z/Zhen:Jacky_Shunjie">academic</a> <a href="https://dblp1.uni-trier.de/pers/hd/z/Zhen:Shunjie_=Jacky=">side</a> of computer science. I even spent a year doing a <a href="https://www.cs.auckland.ac.nz/research/gameai/dissertations/Zhen_MSc_14.pdf">master’s thesis</a>. During this time I had the priviledge of travelling to St Petersburg to <a href="http://www.scoop.co.nz/stories/BU1303/S00933/team-infinitytek-victors-of-the-2013-microsoft-imagine-cup.htm">represent NZ</a> at the <a href="https://www.youtube.com/watch?v=Wsnr0FjjxUI">Microsoft Imagine cup</a>. But student loan debts caught up with me and I eventually had to get <a href="https://www.linkedin.com/in/jacky-shunjie-zhen-5b735042">real jobs</a>. I’ve primarily been a <a href="http://i.imgur.com/lS43VnN.png">full-stack</a> developer, since I enjoy working with both <a href="https://i.redd.it/ku1neu504sh01.jpg">frontend and backend</a>.</p>\n<p>A while back, I played a lot of PC games and did <a href="https://i.imgur.com/S5Pvd48.jpg">pretty well</a> at <a href="https://www.dotabuff.com/players/69866074">some of them</a>. But recently, I’ve become interested in being good at <a href="https://www.facebook.com/MtAlbertToastmasters">public speaking</a>, and <a href="https://www.meetup.com/Go-AKL/events/lgxqcpyxlbcc/">getting more involved</a> in <a href="https://www.meetup.com/rust-akl/">tech communities</a>. I also enjoy <em>starting</em> a lot of useless projects on <a href="https://github.com/jackyzhen">github</a>. Emphasis on starting.</p>\n<p>Even further back I was really into watching <a href="https://www.youtube.com/watch?v=T5Rgk0xOThg">kickboxing</a> and getting <a href="https://www.youtube.com/watch?v=GkZEKFufvQA">beaten up</a>. Nowadays, I struggle to do enough exercise. I really should exercise more.</p>',frontmatter:{title:"Hi, I'm Jacky",date:null,description:null}}},pathContext:{slug:"/about"}}}});
